import { Link } from "react-router-dom";
import { useState } from "react";

const Navbar = () => {
  const [settingsModule, setSettingsModule] = useState(false);

  return (
    <div>
      <ul className="Nav">
        <Link to="/">Home</Link>
        <Link to="/overview">Overview</Link>
        <li>
          <button
            onClick={() => {
              setSettingsModule(!settingsModule);
            }}
          >
            Settings
          </button>
        </li>
      </ul>
    </div>
  );
};

export default Navbar;
